## **Gemini Image Understanding API**

### üìå **Overview**

The **Gemini Image Understanding API Collection** in Postman enables users to analyze and interpret images using the **gemini-1.5-pro-latest** model. We can use the **gemini-1.5-pro-002** model for better wImages with text analysis. This API supports:

- **Analyzing image content**

- **Understanding images with accompanying text prompts**

- **Extracting meaningful descriptions from images**


---

## üìÇ **Collection Structure**

### **1Ô∏è‚É£ Image Analysis**

- **Method:** `POST`

- **Endpoint:** `{{base_url}}/models/{{model_name}}:generateContent?key={{api_key}}`

- **Description:** Processes an image and generates insights based on its content.

- **Request Body Example:**

    ``` json
                        {
                          "contents": [
                            {
                              "parts": [
                                {
                                  "inlineData": {
                                    "mimeType": "image/jpeg",
                                    "data": "/9j/4AAQSkZJRgABAQEASABIAAD/4QAC/..."
                                  }
                                }
                              ]
                            }
                          ]
                        }

     ```

- **Use Case:** Extracts information from an image without additional textual input.


---

### **2Ô∏è‚É£ Image with Text Interpretation**

- **Method:** `POST`

- `{{base_url}}/models/{{model_image_with text_analysis}}:generateContent?key={{api_key}}`

- **Description:** Analyzes an image alongside a user-provided text query.

- ``` json
                    {
                      "contents": [
                        {
                          "parts": [
                            {
                              "inlineData": {
                                "mimeType": "image/jpeg",
                                "data": "/9j/4AAQSkZJRgABAQEASABIAAD/4QAC/..."
                              },
                             { "text": "Describe what this image represents." }
                            }
                          ]
                        }
                      ]
                    }

     ```


- **Use Case:** Provides contextual descriptions based on both image content and user queries.


---

## **üîß Setup & Usage**

### **1Ô∏è‚É£ Configuring Postman Environment**

Create a **Postman Environment** with the following variables:

| Variable | Description | Example Value |
| --- | --- | --- |
| `base_url` | API base endpoint | `https://generativelanguage.googleapis.com/v1beta` |
| `api_key` | Your Google API Key | `your_api_key` |
| `model_name_image_understanding` | Gemini Image Understanding Model | `gemini-1.5-pro-latest` , `gemini-1.5-pro-002` |

---

### **2Ô∏è‚É£ Running the Requests**

1. **Select the Gemini Image Understanding Collection** in Postman.

2. **Choose the API request** (_Image Analysis_ or _Image with Text Interpretation_).

3. **Ensure your environment is active** (containing `base_url` and `api_key`).

4. **Click Send** to receive image analysis results.


---

## **üìñ Example Responses**

### ‚úÖ **Successful Response (200 OK)**

``` json
{
  "candidates": [
    {
      "content": {
        "parts": [
          { "text": "This is an image of a futuristic city with a flying car." }
        ]
      }
    }
  ]
}

 ```

### ‚ùå **Error Responses**

#### **400 - Bad Request**

``` json
{
  "error": {
    "code": 400,
    "message": "Invalid request: Missing required field 'contents'.",
    "status": "INVALID_ARGUMENT"
  }
}

 ```

#### **401 - Unauthorized**

``` json
{
  "error": {
    "code": 401,
    "message": "Invalid API key. Please provide a valid API key.",
    "status": "UNAUTHENTICATED"
  }
}

 ```

#### **429 - Rate Limit Exceeded**

``` json
{
  "error": {
    "code": 429,
    "message": "Quota exceeded. Reduce request frequency or upgrade quota.",
    "status": "RESOURCE_EXHAUSTED"
  }
}

 ```

---

## **üõ† Test Script Explanation**

The API responses are validated using the following Postman test script:

``` javascript
pm.test("Status code is 200", function () {
    pm.response.to.have.status(200);
});
pm.test("Response contains a valid text description", function () {
    var jsonData = pm.response.json();
    pm.expect(jsonData).to.have.property("candidates");
    pm.expect(jsonData.candidates[0].content.parts[0]).to.have.property("text");
});

 ```

This script:

- ‚úÖ Ensures the API returns a **200 OK** response.

- ‚úÖ Checks that the response includes a **valid text description** of the image.


---

## **üìå Key Features & Use Cases**

‚úÖ **Image Analysis:** Extract insights from images without additional text input.  
‚úÖ **Image-Text Interpretation:** Answer questions related to an image's content.  
‚úÖ **AI-Powered Understanding:** Automate image recognition and description.

## **üì¢ Conclusion**

With the **Gemini Image Understanding API Postman Collection**, users can process and interpret images effectively for a variety of applications, including content analysis, AI-driven descriptions, and automated visual intelligence.

